import React from "react";

const Article = ({ urlToImage, title, publishedAt, description, url }) => {
  return (
    <div>
      <img src={urlToImage} alt="article" />
      <h3>{title}</h3>
      <p>{description}</p>
      <p>{publishedAt}</p>
      <button value="Read More">
        <a href={url} alt={url}>
          Read More
        </a>
      </button>
    </div>
  );
};

export default Article;
